import React from 'react';
import CityInformation from './CityInformation';
const cityWeather = require('../sources/city-weather.json');


const CityInfoList = () => {
    const newArray = cityWeather.map(item => (<CityInformation  cityName = {item.cityName} countryName = {item} weathertype = {item.description} weathertype = {item.title} tempMin = {item.title} tempMax = {item.title} location = {item.title}/>))
        return (
            <div className = 'container'>
                <h2>Weather</h2>
                <div className = 'blocks-container'> 
                    {newArray}
                </div>
            </div>
        )
    }
    export default CityInfoList;
